import re
rle = []
for line in RLE_TEXT.splitlines():
    line = line.strip()
    if not line:
        continue
    groups = re.findall(r"\(\s*(\d+)\s*,\s*'(.?)'\s*\)", line)
    if groups:
        rle.append([(int(n), ch) for n, ch in groups])

def reconstruct_ascii_from_rle():
    print("ASCII art using loops and conditions...\n")


    # LOOP 1 — process each row
    for row in rle:
        line_str = ""

        # LOOP 2 — process each (count, char)
        for group in row:
            count = group[0]
            ch = group[1]

            # CONDITION — only decode if count > 0
            if count > 0:
                # LOOP 3 — repeat character 'count' times
                for i in range(count):
                    line_str += ch

        print(line_str)


# RUN PROGRAM
reconstruct_ascii_from_rle()